import React, { useState, useEffect } from "react";
import "./Players.css";

const Players = () => {
  /*const [players, setPlayers] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const playersPerPage = 10;
  const paginationGroupSize = 10;

  useEffect(() => {
    const data = Array.from({ length: 8000 }, (_, i) => ({
      id: i + 1,
      name: `Player ${i + 1}`,
      club: `Club ${i % 20}`,
      nationality: `Country ${i % 10}`,
      position: ["GK", "DC", "MC", "ST"][i % 4],
      rating: Math.floor(Math.random() * 10) + 80,
      contractUntil: "06-2025",
      wage: `${Math.floor(Math.random() * 400) + 50}K p/w`,
      image: i % 7 === 0 ? null : `https://via.placeholder.com/50?text=P${i + 1}`,
    }));
    setPlayers(data);
  }, []);

  const totalPages = Math.ceil(players.length / playersPerPage);
  const indexOfLastPlayer = currentPage * playersPerPage;
  const indexOfFirstPlayer = indexOfLastPlayer - playersPerPage;
  const currentPlayers = players.slice(indexOfFirstPlayer, indexOfLastPlayer);

  // Şu anki sayfa grubunun başlangıç ve bitiş indekslerini hesapla
  const currentPaginationGroup = Math.floor((currentPage - 1) / paginationGroupSize);
  const startPage = currentPaginationGroup * paginationGroupSize + 1;
  const endPage = Math.min(startPage + paginationGroupSize - 1, totalPages);

  // Sayfa değiştirme işlemleri
  const paginate = (pageNumber) => {
    if (pageNumber > 0 && pageNumber <= totalPages) setCurrentPage(pageNumber);
  };

  // Grup değiştirme işlemleri (sol ve sağ tuşlar için)
  const goToPreviousGroup = () => {
    const previousGroupStart = startPage - paginationGroupSize;
    if (previousGroupStart > 0) {
      setCurrentPage(previousGroupStart);
    } else {
      setCurrentPage(1); // En başa gidiyoruz
    }
  };

  const goToNextGroup = () => {
    const nextGroupStart = startPage + paginationGroupSize;
    if (nextGroupStart <= totalPages) {
      setCurrentPage(nextGroupStart);
    } else {
      setCurrentPage(totalPages); // En sona gidiyoruz
    }
  };*/
  const [players, setPlayers] = useState([]);
  const [filteredPlayers, setFilteredPlayers] = useState([]);
  const [filters, setFilters] = useState({
    uniqueId: "",
    club: "",
    nationality: "",
    league: "",
    smartFilters: {
      wonderkids: false,
      contractExpiring: false,
      freeTransfers: false,
      bestBargains: false,
      dynamicPotential: false,
      fastPaced: false,
    },
    line: {
      goalkeepers: false,
      defenders: false,
      midfielders: false,
      attackers: false,
    },
    position: {
      GK: false,
      DL: false,
      DC: false,
      DR: false,
      WBL: false,
      WBR: false,
      ML: false,
      MC: false,
      MR: false,
    },
  });

  useEffect(() => {
    const data = Array.from({ length: 8000 }, (_, i) => ({
      id: i + 1,
      name: `Player ${i + 1}`,
      club: `Club ${i % 20}`,
      nationality: `Country ${i % 10}`,
      league: `League ${i % 5}`,
      position: ["GK", "DL", "DC", "MC", "ST"][i % 5],
      rating: Math.floor(Math.random() * 10) + 80,
      contractUntil: i % 3 === 0 ? "06-2025" : "06-2024",
      wage: `${Math.floor(Math.random() * 400) + 50}K p/w`,
      image: i % 7 === 0 ? null : `https://via.placeholder.com/50?text=P${i + 1}`,
    }));
    setPlayers(data);
    setFilteredPlayers(data);
  }, []);

  useEffect(() => {
    const applyFilters = () => {
      let result = players;

      // Unique ID Filter
      if (filters.uniqueId.trim() !== "") {
        result = result.filter(player =>
          player.id.toString().includes(filters.uniqueId)
        );
      }

      // Club Filter
      if (filters.club.trim() !== "") {
        result = result.filter(player =>
          player.club.toLowerCase().includes(filters.club.toLowerCase())
        );
      }

      // Nationality Filter
      if (filters.nationality.trim() !== "") {
        result = result.filter(player =>
          player.nationality.toLowerCase().includes(filters.nationality.toLowerCase())
        );
      }

      // League Filter
      if (filters.league.trim() !== "") {
        result = result.filter(player =>
          player.league.toLowerCase().includes(filters.league.toLowerCase())
        );
      }

      // Smart Filters
      if (filters.smartFilters.wonderkids) {
        result = result.filter(player => player.rating >= 90); // Örneğin 90+ rating
      }
      if (filters.smartFilters.contractExpiring) {
        result = result.filter(player => player.contractUntil === "06-2024");
      }
      if (filters.smartFilters.freeTransfers) {
        result = result.filter(player => player.wage === "0K p/w"); // Free transfer
      }
      if (filters.smartFilters.bestBargains) {
        result = result.filter(player => player.wage <= "100K p/w"); // Örneğin düşük maaşlı
      }
      if (filters.smartFilters.dynamicPotential) {
        result = result.filter(player => player.rating > 85 && player.rating <= 89);
      }
      if (filters.smartFilters.fastPaced) {
        result = result.filter(player => ["ST", "WBR", "MR"].includes(player.position));
      }

      // Line Filters
      if (filters.line.goalkeepers) {
        result = result.filter(player => player.position === "GK");
      }
      if (filters.line.defenders) {
        result = result.filter(player =>
          ["DL", "DC", "DR", "WBL", "WBR"].includes(player.position)
        );
      }
      if (filters.line.midfielders) {
        result = result.filter(player =>
          ["ML", "MC", "MR"].includes(player.position)
        );
      }
      if (filters.line.attackers) {
        result = result.filter(player => player.position === "ST");
      }

      // Position Filters
      for (const [key, value] of Object.entries(filters.position)) {
        if (value) {
          result = result.filter(player => player.position === key);
        }
      }

      setFilteredPlayers(result);
    };

    applyFilters();
  }, [filters, players]);

  const handleFilterChange = (e) => {
    const { id, value, type, checked, name } = e.target;

    if (type === "checkbox") {
      if (name in filters.smartFilters || name in filters.line || name in filters.position) {
        const category = name in filters.smartFilters ? "smartFilters" : name in filters.line ? "line" : "position";
        setFilters(prevFilters => ({
          ...prevFilters,
          [category]: {
            ...prevFilters[category],
            [name]: checked,
          },
        }));
      }
    } else {
      setFilters(prevFilters => ({
        ...prevFilters,
        [id]: value,
      }));
    }
  };

  return (
    <div className="players-page">
      <aside className="players-sidebar">
        <h2>Filters</h2>
        {/* Unique ID Filter */}
        <div className="filter-group">
          <label htmlFor="uniqueId">Unique ID</label>
          <input type="text" id="uniqueId" placeholder="Unique ID" />
        </div>

        {/* Club Filter */}
        <div className="filter-group">
          <label htmlFor="club">Club</label>
          <input type="text" id="club" placeholder="Club" />
        </div>

        {/* Nationality Filter */}
        <div className="filter-group">
          <label htmlFor="nationality">Nationality</label>
          <input type="text" id="nationality" placeholder="Nationality" />
        </div>

        {/* League Filter */}
        <div className="filter-group">
          <label htmlFor="league">League</label>
          <input type="text" id="league" placeholder="League" />
        </div>

        {/* Smart Filters */}
        <div className="section-title"><strong>Smart Filters
          </strong></div>
        <div className="checkbox-group">

          <tr>
            <label>
              <input type="checkbox" /> Wonderkids
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Contract expiring
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Free transfers
            </label>

          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Best Bargains
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Dynamic Potential
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Fast paced
            </label>
          </tr>
        </div>
        <br></br>
        {/* Line */}
        <div className="section-title">
          <strong>Line</strong></div>
        <div className="checkbox-group">

          <tr>
            <label>
              <input type="checkbox" /> Goalkeepers
            </label>
          </tr>

          <tr>
            <label>
              <input type="checkbox" /> Defenders
            </label>

          </tr>

          <tr>
            <label>
              <input type="checkbox" /> Midfielders
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> Attackers
            </label>

          </tr>
        </div>
        <br></br>
        {/* Position */}
        <div className="section-title"><strong>Position</strong></div>
        <div className="checkbox-group">
          <tr>
            <label>
              <input type="checkbox" /> GK
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> DL
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> DC
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> DR
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> WBL
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> WBR
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> WBR
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> ML
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> MC
            </label>
          </tr>
          <tr>
            <label>
              <input type="checkbox" /> MR
            </label>
          </tr>
        </div>
        
      </aside>

      <main className="players-list">
        <h1>Players</h1>
        <table>
          <thead>
            <tr>
              <th>Photo</th>
              <th>Name</th>
              <th>Club</th>
              <th>Position</th>
              <th>Rating</th>
              <th>Wage</th>
              <th>Contract</th>
            </tr>
          </thead>
          <tbody>
            {currentPlayers.map((player) => (
              <tr key={player.id}>
                <td>
                  {player.image ? (
                    <img
                      src={player.image}
                      alt={player.name}
                      className="player-photo"
                    />
                  ) : (
                    <div className="placeholder-photo">No Image</div>
                  )}
                </td>
                <td>{player.name}</td>
                <td>{player.club}</td>
                <td>{player.position}</td>
                <td>{player.rating}</td>
                <td>{player.wage}</td>
                <td>{player.contractUntil}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <div className="pagination">
          <button
            className="pagination-btn"
            onClick={goToPreviousGroup}
            disabled={currentPage <= paginationGroupSize}
          >
            &lt;&lt;
          </button>

          {Array.from({ length: endPage - startPage + 1 }, (_, i) => {
            const pageNumber = startPage + i;
            return (
              <button
                key={pageNumber}
                className={`pagination-btn ${
                  currentPage === pageNumber ? "active" : ""
                }`}
                onClick={() => paginate(pageNumber)}
              >
                {pageNumber}
              </button>
            );
          })}

          <button
            className="pagination-btn"
            onClick={goToNextGroup}
            disabled={startPage + paginationGroupSize > totalPages}
          >
            &gt;&gt;
          </button>
        </div>
      </main>
    </div>
  );
};

export default Players;
